import React from "react";

class GetInTouch extends React.Component {
  render() {
    return (
      <div
        id="getintouch"
        style={MainDiv}
        data-aos="fade-down"
        data-aos-duration="9000"
      >
        <div style={Heading}>
          <div>Get in touch</div>
        </div>

        </div>
    );
  }
}
const MainDiv = {
    marginTop: "70px",
  };

  const Heading = {
    justifyContent: "center",
    display: "flex",
    fontWeight: "bold",
    fontSize: "40px",
    fontFamily: "playfair display",
    color: "#193964",
    padding: "3%",
  };

export default GetInTouch;
